import React from 'react';
import PostData from '../data/schoolProfiles.json';

function PostList() {
  return (
    <div>
      <h1>School Profiles</h1>
      {PostData.map((schoolProfile, index)=>{
        return <>
        <div class="card" style={{width: 18+ 'rem'}}>
          <img class="card-img-top mx-auto d-block" src={schoolProfile.schoolLogoUrl} alt="Card image cap" style={{width: 100 + 'px', height: 100 + 'px'}}></img>
            <div class="card-body">
              <h5 class="card-title">{schoolProfile.name}</h5>
                <p class="card-text">{schoolProfile.address}</p>
                <a href="#" class="btn btn-primary">WP Code</a>
            </div>
          </div>
        </>
      })}
    </div>
  );
}

export default PostList;
